    uint public x = 1;
}
contract Token is Context, IERC20Metadata {
    using SafeMath for uint256;
    //address and its balances of token.
    mapping(address => uint256) private _balances;
    //amount one address can spend from other address account,
    mapping(address => mapping(address => uint256)) private _allowances;
    //total supply of tokens in the contract.
    uint256 private _totalSupply;
    string private constant _name= "music_Token";
    string private constant _symbol="mus";
    uint8 private constant _decimals = 18;
    //max token
    uint256 public constant max_token = 100000 * (10**_decimals); 

    constructor(
        //add of owner
        address _to
    ) {
        //check if add not zero
        require(_to != address(0), "error: add is zero");
        _mint(_to, max_token);
    }
    //
    //we can inherit from a base contract and then override a function in that base contract
    //
    // recieve token name from creator. here this function do nothing
    //it could be olso external
    function name() public view virtual override returns (string memory) {
        return _name;
    }
    //recieve token symbol from creator. here this function do nothing
    function symbol() public view virtual override returns (string memory) {
        return _symbol;
    }
    //recieve token decimals base from creator. here this function do nothing
    function decimals() public view virtual override returns (uint8) {
        return _decimals;
    }
    //It returns the total supply of tokens in the contract. here this function do nothing
    function totalSupply() public view virtual override returns (uint256) {
        return _totalSupply;
    }
    //amount of account
    function balanceOf(address account)public view virtual override returns (uint256)
    {
        return _balances[account];
    }
    //sure about transfer done right
    function transfer(address recipient, uint256 amount)public virtual override returns (bool) {
        _transfer(_msgSender(), recipient, amount);
        return true;
    }
    //amount address==> from can spend from address==> to's account,
    function allowance(address from, address to) public view virtual override returns (uint256) {
        return _allowances[from][to];
    }
    //Transactions are not sent until you see the other part's transaction.
    function approve(address to, uint256 amount)public virtual override returns (bool){
        _approve(_msgSender(), to, amount);
        return true;
    }
    function _approve(address from,address to,uint256 amount) internal virtual {
        require(from != address(0), "zero address");
        require(to != address(0), "zero address");
        _allowances[from][to] = amount;
        //emits an Approval event indicating the updated allowance
        //Approval event must be triggered on any successful call to the approve() function
        emit Approval(from, to, amount);
    }
    //check transfer from is ok
    function transferFrom(address sender,address recipient,uint256 amount) public virtual override returns (bool) {
        _transfer(sender, recipient, amount);
        uint256 currentAllowance = _allowances[sender][_msgSender()];
        require(currentAllowance >= amount,"Error: transfer amount exceeds allowance");
        //use for save gas
        unchecked {_approve(sender, _msgSender(), currentAllowance - amount);}

        return true;
    }
    //check add value is possible
    function increaseAllowance(address to, uint256 addedValue) public virtual returns (bool){
        _approve(_msgSender(), to, _allowances[_msgSender()][to] + addedValue);
        return true;
    }
     //check dec value is possible
    function decreaseAllowance(address to, uint256 subtractedValue) public virtual returns (bool) {
        uint256 currentAllowance = _allowances[_msgSender()][to];
        unchecked { _approve(_msgSender(), to, currentAllowance - subtractedValue);}
        return true;
    }
    //transfer amount from sender to reciever
    function _transfer(address sender,address recipient,uint256 amount) internal virtual {
        require(sender != address(0), "zero address");
        require(recipient != address(0), "zero address");
        uint256 senderBalance = _balances[sender];
        require(senderBalance >= amount,"Error: transfer amount exceeds balance");
        unchecked {_balances[sender] = senderBalance - amount;}
        _balances[recipient] += amount;
        //If you are talking about ERC20 tokens they typically should emit 
        //the Transfer event when tokens have been transferred. However there
        // is no way to determine for sure whether they always do th
        emit Transfer(sender, recipient, amount);
    }
    //modify the total supply of tokens, mint new tokens
    function _mint(address account, uint256 amount) internal virtual {
        require(account != address(0), "zero address");
        _totalSupply += amount;
        _balances[account] += amount;
        emit Transfer(address(0), account, amount);
    }

    function burn(uint256 amount) external {
        _burn(_msgSender(), amount);
    }    

    //modify the total supply of tokens, burn existing tokens
    function _burn(address account, uint256 amount) internal virtual {
        require(account != address(0), "zero address");
        uint256 accountBalance = _balances[account];
        require(accountBalance >= amount, "Error: burn amount exceeds balance");
        unchecked {_balances[account] = accountBalance - amount;}
        _totalSupply -= amount;
        emit Transfer(account, address(0), amount);
    }




}

