   function mul(uint256 a, uint256 b) internal pure returns (uint256) {
        return a * b;
    }

    function div(uint256 a, uint256 b) internal pure returns (uint256) {
        return a / b;
    }

    function mod(uint256 a, uint256 b) internal pure returns (uint256) {
        return a % b;
    }

    function add(uint256 a, uint256 b) internal pure returns (uint256) {
        return a + b;
    }
    function sub(uint256 a, uint256 b) internal pure returns (uint256) {
        return a - b;
    }

     function flag_Add(uint256 a, uint256 b) internal pure returns (bool, uint256) {
        unchecked {uint256 c = a + b;if (c < a) return (false, 0);
            return (true, c);
        }
    }

    function flag_Sub(uint256 a, uint256 b) internal pure returns (bool, uint256) {
        unchecked {if (b > a) return (false, 0);
            return (true, a - b);
        }
    }

    function flag_Mul(uint256 a, uint256 b) internal pure returns (bool, uint256) {
        unchecked {if (a == 0) return (true, 0);uint256 c = a * b; if (c / a != b) return (false, 0);
            return (true, c);
        }
    }

    function flag_Div(uint256 a, uint256 b) internal pure returns (bool, uint256) {
        unchecked {if (b == 0) return (false, 0);
            return (true, a / b);
        }
    }

    function flag_Mod(uint256 a, uint256 b) internal pure returns (bool, uint256) {
        unchecked {
            if (b == 0) return (false, 0);
            return (true, a % b);
        }
    }

}
